import { Cards } from './components/Cards/Cards'
import {Filter} from './components/Filter'
import cats from './mocks/cats.json'

function App() {
  return (
    <div className="App">
        <Filter />
        <Cards cats={cats}/>
    </div>
  );
}

export default App;
